import React,{Component} from 'react';
import { Nav,Navbar,Button } from 'react-bootstrap';

import MaterialTable from 'material-table'

import '../App.css';
import 'bootstrap/dist/css/bootstrap.min.css';


const useStyles = makeStyles((theme) => ({
  icon: {
    marginRight: theme.spacing(2),
  },
  homecoverdiv: {
    display:'flex',
    alignItems:'center',
    justifyContent:'center',
    width:'100%',
  },
  homecover: {
    width:'100%',
  },
  heroContent: {
    backgroundColor: theme.palette.background.paper,
    padding: theme.spacing(8, 0, 6),
    backgroundColor: '#f7ebea',
  },
  heroButtons: {
    marginTop: theme.spacing(4),
  },
  cardGrid: {
    paddingTop: theme.spacing(8),
    paddingBottom: theme.spacing(8),
  },
  card: {
    height: '100%',
    display: 'flex',
    flexDirection: 'column',
  },
  cardMedia: {
    paddingTop: '56.25%', // 16:9
  },
  cardContent: {
    flexGrow: 1,
  },
  footer: {
    backgroundColor: theme.palette.background.paper,
    padding: theme.spacing(6),
  },
  iconColor: {
    backgroundColor:'#9e7d7a',
  }
}));


export default function ProductForSeller() {

  return (

    <div>
      <Navbar className="brand-bar" style={{justifyContent:'space-between'}}>
        <Navbar.Brand>Stella Boutique</Navbar.Brand>
          <div>
            <Button href="/" className={classes.navButtons} variant="contained" color="primary">
              logout
            </Button>
          </div>
      </Navbar>
      
      {/* <MaterialTable
          columns={[
            { title: 'Adı', field: 'name' },
